import { useState } from "react";
import ParkingAddressModal from "../../components/modals/ParkingAddressModal";
import NavBarComp from "../../components/NavBarComp";
import { getCurrentLocation, getDirectionToParkingSpot  } from "../../utils/LocationManager";


function ParkingPage({cities}) {
    const [location,updateLocation]                                = useState();
    const [parkingLatLng, updateParkingLatLng]                     = useState();
    const [currentLatLng, updateCurrentLatLng]                     = useState();
    const [showParkingAddressModal ,updateShowParkingAddressModal] = useState(false);

    if (showParkingAddressModal){
        return <ParkingAddressModal show={showParkingAddressModal} onClose={()=>updateShowParkingAddressModal(false)} updateLocation={updateLocation} cities={cities}/>
    }

    const setParkingMainButtonText = ()=>{
        if (typeof parkingLatLng === 'undefined' && typeof location === 'undefined'){
            return "Save Parking";
        }
        else {
            return "Find My Car";
        }
    }

    const onMainParkingButtonClick = ()=> {
        if (typeof parkingLatLng === 'undefined' && typeof location === 'undefined'){
            getCurrentLocation(updateParkingLatLng, updateShowParkingAddressModal)
        }
        else {
            getCurrentLocation(updateCurrentLatLng ,updateShowParkingAddressModal);
        }

    }
    if (typeof currentLatLng !== 'udefined'){
        console.log(currentLatLng);
        return(<iframe
            width="800"
            height="600"
            style={{border:0}}
            loading="lazy"
            allowFullScreen
            src="https://www.google.com/maps/embed/v1/directions
  ?key=AIzaSyCNKfsXeTiMfS66RSVSMuYv5BEQVw5ohbI
  &origin=Oslo+Norway
  &destination=Telemark+Norway
  &avoid=tolls|highways"
            >
        </iframe>)
    }

    return(<div>
            <NavBarComp />    
            {parkingLatLng ? <iframe
                width="800"
                height="600"
                style={{border:0}}
                loading="lazy"
                allowFullScreen
                src={`https://www.google.com/maps/embed/v1/place?key=AIzaSyCNKfsXeTiMfS66RSVSMuYv5BEQVw5ohbI&q=${parkingLatLng.lat},${parkingLatLng.lng}`}
                >
            </iframe> : <div>Would you like to park ?</div>}
            {location ? <iframe
                width="800"
                height="600"
                style={{border:0}}
                loading="lazy"
                allowFullScreen
                src={`https://www.google.com/maps/embed/v1/place?key=AIzaSyCNKfsXeTiMfS66RSVSMuYv5BEQVw5ohbI&q=${location}`}
                >
            </iframe> : <div>Would you like to park ?</div>}    
            <div>
                <button onClick={()=>onMainParkingButtonClick()}>{setParkingMainButtonText()}</button>
            </div>

        </div> )
    }



export default ParkingPage
